contracts/function.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >0.7.0 <= 0.9.0;

import "./lib.sol";

contract suma{

    using operaciones for uint256;

    function sumar(uint256 _a, uint256 _b, uint256 _c) external pure returns(uint256){
        uint256 resultado;
        
        resultado = _a.add(_b, _c);
        return (resultado);
    }
}

contracts/lib.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >0.7.0 <=0.9.0;

library operaciones {

	//sobrecarga de funciones

    function add(uint256 a, uint256 b) public pure returns (uint256){
        return a + b ;
    }

    function add(uint16 a, uint16 b) public pure returns (uint256){
        return a * b ;
    }

    function add(uint256 a, uint256 b, uint256 c) public pure returns (uint256){
        return a + b + c ;
    }

}

